pragma solidity ^0.5.16;
// import "zeppelin-solidity/contracts/token/ERC20/StandardToken.sol";
import "./GargToken.sol";

contract TestCon{

  GargToken public tokenContract;
  address payable public _owner;
  address payable wallet = 0xc11e769CE3bfa4a1FCA8A7BCac8Cc3459c77Cba4;
  event Sell(address _buyer, uint256 _amount);
  constructor(GargToken _tokenContract) public payable{
    tokenContract = _tokenContract;
    _owner = msg.sender;
  }
  function buyfirst(uint256 _numberOfTokens) external payable{
    emit Sell(msg.sender,_numberOfTokens);
    require(
      tokenContract.transfer(msg.sender,_numberOfTokens)
    );
    wallet.transfer(msg.value);
  }
}
